import React, { Component } from "react";
//import styled, { css } from "styled-components";

function CupertinoButtonInfo(props) {
  return (
    <Container {...props}>
      <Next>Next&gt;&gt;&gt;&gt;</Next>
    </Container>
  );
}

const Container = styled.div`
  display: flex;
  background-color: rgba(89,123,70,1);
  justify-content: center;
  align-items: center;
  flex-direction: row;
  border-radius: 5px;
  padding-left: 16px;
  padding-right: 16px;`
;

const Next = styled.span`
  font-family: Roboto;
  color: #fff;
  font-size: 32px;
  font-weight: 500;`
;

export default CupertinoButtonInfo;
